import ColoredBox from '../components/ColoredBox/ColoredBox'
const Lobra = () => {

  const boxes = [
    { width: '480px', height: '400', backgroundColor: 'red'}
  ]

  return (
    <div>
      <Navbar />
      <ColoredBox height="400px" width="480px" backgroundColor="#000"/>
      <Footer />
    </div>
  )
}

export default Lobra
